(window.webpackJsonp=window.webpackJsonp||[]).push([[2],{83:function(a){a.exports=JSON.parse('{"metadata":{"timed":false,"story ID":"077e3be9-887e-4c3d-9e75-11c1c37b44c7","title":{"ura":"Ela nekuaüna","_default":"ela"},"media":{"audio":"","video":""},"languages":["ura","es","en"],"date_created":"","date_uploaded":"1/24/2026","source":{"_default":""},"description":"","genre":"","author":"","glosser":"","speakers":[],"xml_file_name":"ela.xml","source_filetype":"FLEx","tier IDs":{"Traducción":{"subdivided":false},"Notas":{"subdivided":false}},"speaker IDs":{}},"sentences":[{"num_slots":10,"text":"Inuaelü kaje kuaüneein kana nekuaüna, kana neferatiia kana kuaünera ne","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":10,"value":"Desde muy antes, desde que Dios nos creó, "}]}],"sentence_id":1},{"num_slots":22,"text":"Inuaelü kaje kuaüneein kaa ela jaakaanü, kanaakaanü reaaürüüa kanaakaanü relaaürera najaün, kana kuaünera cha kuaünaai, kana neferateeürera kanaakaanü relae kaa rane janaake.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":22,"value":"nos enseñaron a elaborar el cachihuango; por eso, elaboramos el cachihuango. Desde que nos enseñaron a elaborar los que nos enseñaron, desde ese momento, elaboramos, desde que nuestro Dios nos creó y nos enseñó."}]}],"sentence_id":2},{"num_slots":18,"text":"Nii najaüna enene inaaen nerelaain kaa rane jaakaanü kanaakaanü relaakuaürüüa najaün, nerelaain rane tajaruaain jaain kufuichuteein naunfuaain jaakaanü.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":18,"value":"Por eso, nosotros hemos aprendido a elaborar cachihuango y tejemos poniendo su kufuichu. Así, le elaboramos; así, trenzamos la soga para amarrarnos con eso y tejemos."}]}],"sentence_id":3},{"num_slots":40,"text":"Karijieein kaa amekuke nichurateein jaakaanü, rai tanu amaa nakanane jana ichüünijianaain saüjiin tiia saijieein jisinakaaichera kaa jisinakaaichera kaate naane kaijiü jisinakaatera bebejeeicha sichaanane nainjietau alaa nüjüa chuaae dralaaitin rai biji üsichuue saaütaa najaün kuduunete nii alaa nüjüa chuaae rai biji.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":40,"value":"Dice llevó a su suegra, su yerno y cerca nomás encontró, le cosechó [el cachihuango] y le amontonó y no lo pudo elaborar. Le dijo: “ayúdame a elaborar [el cachihuango]”, diciendo le exigió al yerno. De tanto [exigir], el yerno se molestó [y] le dijo: “elabora usted tanto que quieres elaborar” y le agarró las manos de la suegra. Le cortó todos los dedos de la mano poniendolos en un tronco de aguaje."}]}],"sentence_id":4},{"num_slots":42,"text":"Nii jaün jetaute inuaelü kaa“ jiriri jiriri” nanai kaa ajiri rai kachaneein cheteteriiüte kaa kanü biji kureei karijieein kaitiia kakananaa najaün, kichana ichanee netuje lanaa ichakaaün najaün kanü biji richaataanaa najaün kanü ichanaa ichakaaün ne kuina kanü biji kuütüri kureeita ajiri, naa najaün.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":42,"value":"Y le dejó y escuchó un ave que decía jiriri, jiriri y le dijo: “¿Cómo no eres persona para que me ayudes?; mi yerno me cortó los dedos, porque no sé elaborar cachihuango”. Yo [la mujer/suegra] dije a ajiri¹ que me ayude si fuera persona, porque mi yerno cortó todos mis dedos de mi mano."}]},{"tier":"Notas","values":[{"start_slot":0,"end_slot":42,"value":"¹ Ajiri: nombre del ave que ayuda a la protagonista."}]}],"sentence_id":5},{"num_slots":11,"text":"Nii baia neuriin jetaute rai ekukuin,“ kanüraite aitukuincha” nae leejiin kacha,","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":11,"value":"En unos minutos, se acercó una persona diciendo: “a mí me dijiste”,"}]}],"sentence_id":6},{"num_slots":28,"text":"“ Kanüna ii relareüni”,“ chanüte nituaneein ii te ii nakana, kuatia kaaintaain ichanakainiien kariinanai” naain“ alaa nüjüa faufaua maichuke” nii kacha ekuna najaün nerefakatae alaa nüjüa kaje ela ichanuineein.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":28,"value":"“yo te enseño a elaborar” y también le dijo: “¿Por qué tu yerno te tiene que cortar los dedos? No es difícil de elaborar, te voy a enseñar”. “Golpea el tronco con los talones de tus pies”, le dijo la persona que se apareció. Entonces, golpeó y, en ese momento, cayó el cachihuango. "}]}],"sentence_id":7},{"num_slots":20,"text":"“ Inuta mitaain alaa nüjüa faufaua” naa najaün nuta mitaain alaa nüjüa faufaua najaün nerefakatae nii alaa nüjüa kaje ela ichanuineein.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":20,"value":"[La persona que se apareció] le dijo: “Cierra tus ojos y golpea el tronco de aguaje” y ella lo obedeció, le golpeó y se cayó el cachihuango tejido del tronco del aguaje."}]}],"sentence_id":8},{"num_slots":38,"text":"Rai nenajaün kaüüa kürauri küüane ela amaain najaün jetaute kaje baja kuaüre leeuchaürü enekürü, ne jetaute nabana be, nii najaün jetaute ajelaüre biiane kuina, nii najaün jetaute be, kuatiia kaaintaai leejiin tajaae ajiri te kanü relae naain be.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":38,"value":"Entonces, ella regresó a su casa llevando un capillejo lleno de cachihuango y le comenzaron a preguntar las demás mujeres, y no quería contar y, de tanto, le hicieron embriagar para que cuente, y fue ahí donde ella les cuenta que no es fácil de elaborar [y] que un ave ajiri le enseñó."}]}],"sentence_id":9},{"num_slots":22,"text":"Ajeein akaürü rai biiane kaje kuaüneein te inaaen rane janaa ke nerelajakuaüre ela janaa ke nii rijijieein inaaen satiin ela jaüre enekürü.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":22,"value":"Como ella les contó, desde esa vez, todos ya aprendieron a elaborar el cachihuango y siguen elaborando el cachihuango las personas que viven en la montaña."}]}],"sentence_id":10}]}')}}]);